import axios from "axios";
import { useEffect, useState } from "react";
import { useParams } from "react-router";
import Endpoints from "../apis/Endpoints";
import Navbar from "../components/Navbar";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faTrash } from "@fortawesome/free-solid-svg-icons";

const ProductOrderSummary = () => {
    const { id } = useParams();
    console.log(id)
    console.log(Endpoints.PRODUCTS_URL + id)

    const [product, setProduct] = useState({})


    const getData = () => {
        axios.get(Endpoints.PRODUCTS_URL + id)
            .then((response) => {
                console.log(response.data);
                setProduct(response.data);
            })
            .catch(error => console.log(error))
    };
    useEffect(() => {
        getData()
    }, [id])


    //   const handleDelete = (productId) => {
    //     setProduct((prevProducts) => prevProducts.filter((product) => product.id !== productId));
    //   };
    return (
        <>
            <Navbar />
            <div className="rowordersummary" style={{ border: "solid lightgrey" }}>
                <img src={product.image} alt="" className="img-fluid" style={{ marginTop: "50px", height: "200px", maxWidth:"200px" }} />
                <div className="row">
                <div className="col-sm-7">

<h3>Brand</h3>
<FontAwesomeIcon
    icon={faTrash}
    // onClick={() => handleDelete(product.id)}
    style={{
        cursor: "pointer",
        position: "absolute",
        top: "10px",
        right: "10px",
    }}
/>
<h5 style={{ color: 'grey' }}>{product.title}</h5>
</div>
<div>
<h2 style={{ fontsize: '20px', justifyContent: 'flex-end', color: 'grey' }}>
    <span>&#36;</span>
    <span >
    {product.price}
    </span>
</h2>
</div>
                </div>



                <div className="col-sm-3" >
                    <h5>Order Summary</h5>
                    <table style={{ marginTop: "20px" }}>
                        <thead>

                            <tr>
                                <td>SubTotal</td>
                                <td><span>&#36;</span>{product.price}</td>
                            </tr>
                            <tr>
                                <td>ShoppingEstimate</td>
                                <td><span>&#36;</span>5</td>
                            </tr>
                            <tr>
                                <td>TaxEstimate</td>
                                <td><span>&#36;</span>5</td>
                            </tr>
                            <tr>
                                <td><h6 >Order Total</h6></td>
                                <td><h6><span>&#36;</span>{product.price + 5 + 5}</h6></td>
                            </tr>
                        </thead>

                    </table>



                </div>

            </div>



        </>
    )
}

export default ProductOrderSummary
